import React from "react";
import { TheContent, TheSidebar, TheFooter, TheHeader } from "./index";

const TheLayout = () => {
  return (
    <div className="c-app c-default-layout">
      <h1>SIDEBAR</h1>
      <TheSidebar />
      <div className="c-wrapper">
        <h1>HEADER</h1>
        <TheHeader />
        <div className="c-body">
          <h1>CONTENT</h1>
          <TheContent />
        </div>
        <h1>FOOTER</h1>
        <TheFooter />
      </div>
    </div>
  );
};

export default TheLayout;
